import React, { Component } from 'react';
import {Header, CustomInput, AlbumsTable} from './components/';

class App extends Component {

  render(){
    return (
      <div className="App">
        <Header />
        <CustomInput />
        <AlbumsTable />
      </div>
    );
  }
}

export default App;
